BEGIN;
DROP TABLE IF EXISTS "geometry"."dtm";
CREATE TABLE "geometry"."dtm" ("rid" serial PRIMARY KEY,"rast" raster);
COPY "geometry"."dtm" ("rast") FROM stdin;




\.
CREATE INDEX ON "geometry"."dtm" USING gist (st_convexhull("rast"));
ANALYZE "geometry"."dtm";
SELECT AddRasterConstraints('geometry','dtm','rast',TRUE,TRUE,TRUE,TRUE,TRUE,TRUE,FALSE,TRUE,TRUE,TRUE,TRUE,TRUE);
END;
VACUUM ANALYZE "geometry"."dtm";
